import React from 'react';
import Pointer from '../components/UI/pointer/pointer';

function Card({ carddata }) {
    return <div className='innercard'>
        <img src={carddata.picture} className='innerpic' />
        <Pointer map={carddata.googleurl} address={carddata.address} />
        <h3>{carddata.title}</h3>
        <p>Price: ${carddata.price}</p>
        <p>Space: {carddata.space}Sqm</p>
        <p>About: {carddata.des}</p>
    </div>
}

export default Card;
